import React, { Component } from 'react' ;
import {Link} from 'react-router-dom' ;
import 'bootstrap/dist/css/bootstrap.min.css' ;

export default class Navbar extends Component {
    render() {
        return(

            <div>
                <nav class="navbar navbar-expand-sm bg-dark navbar-dark sticky-top">
                    <a className='navbar-brand' href="https://www.melkartje.com/" target="_blanck"> <img src="../Melkart.png.png" /> </a>
                    <ul class="navbar-nav">
                        <li class="nav-item">
                            <Link to="/" > Result </Link>
                        </li> 
                        <li class="nav-item">
                            <Link to="/AddComp" > Add Competence </Link> 
                        </li> <br />
                        <li class="nav-item">
                            <Link to="/AddDep" > Add Department </Link>
                        </li>
                        <li class="nav-item">
                            <Link to="/AddCandid" > Add Candidate </Link>
                        </li>
                    </ul>
                </nav>
            </div>
)
}
}
